// âœ… Fungsi helper untuk deteksi tema SINKRON (sebelum component render)
function getInitialTheme() {
  if (typeof window === 'undefined') return true;
  
  const theme = document.documentElement.getAttribute("data-theme") || 
                document.documentElement.className;
  return theme.includes("dark") || document.documentElement.classList.contains("dark");
}

export default function Hero() {
  const heroRef = useRef(null);
  const mouse = useRef({ x: 0, y: 0 });
  
  // âœ… Deteksi tema LANGSUNG saat inisialisasi state (sinkron)
  const [isDark, setIsDark] = useState(() => getInitialTheme());

  // âœ… Effect untuk observasi perubahan tema
  useEffect(() => {
    const checkTheme = () => {
      const theme = document.documentElement.getAttribute("data-theme") || 
                    document.documentElement.className;
      const newIsDark = theme.includes("dark") || document.documentElement.classList.contains("dark");
      setIsDark(newIsDark);
    };

    const observer = new MutationObserver(checkTheme);
    observer.observe(document.documentElement, {
      attributes: true,
      attributeFilter: ["data-theme", "class"],
    });

    return () => observer.disconnect();
  }, []);

  // âœ… GSAP animations - akan langsung jalan dengan warna yang benar
  useEffect(() => {
    gsap.fromTo(
      "#hero-name",
      { y: 24, opacity: 0 },
      { y: 0, opacity: 1, duration: 1.4, ease: "power2.out", delay: 0.5 }
    );

    gsap.fromTo(
      "#hero-role",
      { y: 16, opacity: 0 },
      { y: 0, opacity: 1, duration: 1, ease: "power2.out", delay: 0.8 }
    );
  }, []);

  // âœ… Mouse tracking & radial gradient animation
  useEffect(() => {
    const node = heroRef.current;
    if (!node) return;

    const handleMove = (e) => {
      const rect = node.getBoundingClientRect();
      mouse.current.x = e.clientX - rect.left;
      mouse.current.y = e.clientY - rect.top;
    };

    let rafId;
    const animate = () => {
      if (node) {
        node.style.background = `
          radial-gradient(
            600px circle at ${mouse.current.x}px ${mouse.current.y}px,
            rgba(168, 85, 247, 0.15),
            transparent 80%
          )
        `;
      }
      rafId = requestAnimationFrame(animate);
    };

    node.addEventListener("mousemove", handleMove);
    animate();

    return () => {
      if (rafId) cancelAnimationFrame(rafId);
      if (node) node.removeEventListener("mousemove", handleMove);
    };
  }, []);

  return (
    <section 
      ref={heroRef}
      className="relative min-h-screen flex items-center justify-center px-6 overflow-hidden bg-white dark:bg-transparent"
    >
      {/* BACKGROUND PARTICLES */}
      <div className="absolute inset-0 z-0 pointer-events-none"> 
        <Particles
          particleCount={isDark ? 250 : 150}
          particleColors={
            isDark 
              ? ["#ffffff", "#a855f7", "#6366f1"]
              : ["#6366f1", "#94a3b8", "#cbd5e1"]
          }
          alphaParticles
          particleBaseSize={isDark ? 80 : 40}
          speed={0.1}
        />
      </div>

      {/* CONTENT LAYER */}
      <div className="relative z-10 flex min-h-screen items-center justify-center px-6"> 
        <div className="text-center max-w-4xl">
          <h1
            id="hero-name"
            className="text-4xl md:text-4xl font-extralight tracking-[0.12em] mb-4"
            style={{ 
              color: isDark ? 'white' : '#0f172a',
              opacity: 0
            }}
          >
            HI, I AM
          </h1>
          
          <SignatureSVG
            color={isDark ? "rgba(255,255,255,0.8)" : "rgba(15,23,42,0.8)"}
          />

          <p
            id="hero-role"
            className="mt-8 text-sm md:text-base tracking-[0.3em] uppercase"
            style={{ 
              color: isDark ? 'rgba(255,255,255,0.6)' : 'rgba(15,23,42,0.8)',
              opacity: 0
            }}
          >
            Front-End Developer
          </p>
        </div>
      </div>

      <div className="absolute bottom-10 left-1/2 -translate-x-1/2 z-20">
        <svg 
          width="30" height="30" viewBox="0 0 24 24" fill="none" 
          stroke={isDark ? "white" : "black"} className="animate-bounce opacity-50"
        >
          <path d="M7 13l5 5 5-5M7 6l5 5 5-5" strokeWidth="1.5" strokeLinecap="round" strokeLinejoin="round"/>
        </svg>
      </div>
    </section>
  );
}